Hi, I have briskly gone through the comment history and guess what i have another solution to it. Please bear with me for this and fret not ;)

    class _dot_dict(dict):
      __setattr__= dict.__setitem__
      __delattr__= dict.__delitem__

      def __init__(self, data):
        for name, value in data.items():
          setattr(self, name, self._wrap(value))

      def __getattr__(self, attr):
        return self.get(attr, None)

      def _wrap(self, value):
        if isinstance(value, list):
          return [self._wrap(v) for v in value]  # recursion!
        else:
          if isinstance(value, dict):
            return _dot_dict(value)  # recursion!
          else:
            return value

    class DictionaryField(Field):
    """Base class for fields consisting of dictionary of several sub-fields."""

      def _load(self, body, resource, nested_in=None):
        nested_in = (nested_in or []) + self._path
        value = super(DictionaryField, self)._load(body, resource, nested_in)
        if value is None:
            return None
        return _dot_dict(value)

And the test cases can be as follows:

    TEST_JSON = {
      ...
      'Dictionary': {
        'key1': {
            'property_1_a': {
                'property_1_a_a': 'value1',
                'property_1_a_b': 'value2'
            },
            'property_1_b': 'value3'
        },
        'key2': {
            'property_2_a': 'value4',
            'property_2_b': 'value5'
        },
        'key3': [{
            'property_3_a': 'value6',
            'property_3_b': 'value7'}, 'value8'],
        }
    }

    class ComplexResource(resource_base.ResourceBase):
      ...
      dictionary = resource_base.DictionaryField('Dictionary')

    # test cases
    self.assertEqual(3, len(self.test_resource.dictionary))
    self.assertEqual('value2', self.test_resource.dictionary.key1.property_1_a.property_1_a_b)
    self.assertEqual('value5', self.test_resource.dictionary.key2.property_2_b)
    self.assertEqual('value7', self.test_resource.dictionary.key3[0].property_3_b)
    self.assertEqual('value8', self.test_resource.dictionary.key3[1])

Here, in brief, I have tried making the dict values getting accessed by dot notation and that too at nested levels (along with the subscript level operations of dict as well).'}, {'account_id': 16635, 'date': '2018-08-07 05:08:45.000000000', 'content': 'Patch Set 2:

(1 comment)'}, {'account_id': 16635, 'date': '2018-08-07 09:17:43.000000000', 'content': "Patch Set 2: Code-Review+1

While I was going through the patch[0] I got the context of this patch. So the objective is to get the desired results from the following:

    self.test_resource.dictionary['key1'] => Some_Field_object (can be CompositeField to access dot attribute notation)
    self.test_resource.dictionary['key2'].property_a => the corresponding value (as a corollary to the earlier expectation)
    self.test_resource.dictionary.keys() => to give ['key2', 'key1']

I am kind of OK with this patch as the same has been done for the ``ListField`` approach. But even there also I had a that concern that this approach makes things little confusing. Refer my comment [1]. My prompt upvote was would have been to an approach like:

    dictionary = base.FieldDictionary('Dictionary', item_type=MyCompositeField)

where MyCompositeField for instance resembles a Message object:

    class MyCompositeField(base.CompositeField):
      resolution = base.Field('Resolution')
      severity = base.Field('Severity')

Anyway if we wish to maintain consistency here also then we should rather not deviate in this case of ``DictionaryField`` and follow the same fashion as that of ``ListField`` approach. But by any chance if you wish to change the way it is done now then my 2 cents for this little code snippet :) ...

    def _load(self, body, resource, nested_in=None):
        nested_in = (nested_in or []) + self._path
        value = super(FieldDictionary, self)._load(body, resource, nested_in)
        if value is None:
            return None

        self._value = value
        instance = copy.copy(self)
        for k in value:
          setattr(instance, k, self._item_type(k)._load(value, resource, nested_in))

        return instance

And ``FieldDictionary`` needs to inherit from ``collections.Mapping`` and ``Field`` and implement the required Mapping methods. One such method would look like:

    def __getitem__(self, key):
      if key in self._value:
        return getattr(self, key)
      else:
        raise KeyError(key)


